  `generic_id` varchar(15) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `primary_unit_id` int(11) NOT NULL,
  `min_qty` int(11) DEFAULT '0',
  `max_qty` int(11) DEFAULT '0',
  `safe_stock_rate` double(6,2) DEFAULT '0.00',
  `min_modifier_qty` int(11) DEFAULT '0',
  `max_modifier_qty` int(11) DEFAULT '0',
  `requisition_quota_qty` int(11) DEFAULT '0',
  `is_active` char(1) NOT NULL DEFAULT 'Y',
  `source_warehouse_id` int(11) DEFAULT NULL,
  `use_total` int(11) NOT NULL DEFAULT '0' COMMENT 'ยอดการใช้ในช่วงวันที่',
  `use_per_day` int(11) NOT NULL DEFAULT '0' COMMENT 'อัตราการใช้ต่อวัน',
  `safety_min_day` int(11) NOT NULL DEFAULT '0' COMMENT 'safty stock (วัน)',
  `safety_max_day` int(11) NOT NULL DEFAULT '0' COMMENT 'safty stock (วัน)',
  `from_stock_date` date NOT NULL COMMENT 'stock ตั้งแต่วันที่',
  `to_stock_date` date NOT NULL COMMENT 'stock ถึงวันที่',
  `lead_time_day` int(11) NOT NULL DEFAULT '0' COMMENT 'lead time (วัน)',
  `rop_qty` int(11) NOT NULL DEFAULT '0' COMMENT 'reorder point',
  `ordering_cost` double(32,16) NOT NULL DEFAULT '0.0000000000000000' COMMENT 'ต้นทุนในการสั่งซื้อ',
  `carrying_cost` double(32,16) DEFAULT NULL COMMENT 'ต้นทุนในการเก็บรักษา',
  `eoq_qty` int(11) DEFAULT NULL,
  PRIMARY KEY (`warehouse_id`,`generic_id`),
  UNIQUE KEY `product_planning_id` (`generic_planning_id`),
  KEY `index` (`warehouse_id`,`generic_id`,`primary_unit_id`,`is_active`,`source_warehouse_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

