-- ----------------------------
-- Table structure for mm_generics
-- ----------------------------
DROP TABLE IF EXISTS `mm_generics`;
CREATE TABLE `mm_generics` (
  `generic_id` varchar(15) NOT NULL DEFAULT '',
  `generic_name` varchar(200) DEFAULT NULL,
  `working_code` varchar(50) DEFAULT NULL,
  `short_code` varchar(100) DEFAULT NULL,
  `description` varchar(250) DEFAULT NULL,
  `keywords` varchar(150) DEFAULT NULL,
  `group_id` int(11) DEFAULT NULL,
  `account_id` int(11) DEFAULT NULL,
  `dosage_id` int(11) DEFAULT NULL,
  `generic_type_id` int(11) DEFAULT NULL,
  `is_planning` char(1) NOT NULL DEFAULT 'Y' COMMENT 'N: ไม่ทำแผน, Y: ทำแผน',
  `primary_unit_id` int(11) DEFAULT NULL COMMENT 'หน่วยย่อย: mm_units.unit_id',
  `standard_cost` double(32,16) DEFAULT NULL,
  `unit_cost` double(32,16) DEFAULT NULL COMMENT 'ราคาต่อหน่วยย่อย',
  `purchasing_method` int(11) DEFAULT NULL COMMENT 'ลักษณะการซื้อ: l_bid_type.bid_id',
  `planning_freeze` tinyint(1) DEFAULT '0' COMMENT '0: unfreeze, 1: freeze',
  `planning_unit_generic_id` int(11) DEFAULT NULL COMMENT 'ขนาดบรรจุ: mm_unit_generic.unit_generic_id',
  `is_active` char(1) DEFAULT 'Y',
  `planning_method` char(1) DEFAULT '1' COMMENT '1: Min/Max, 2: EOQ',
  `eoq_qty` int(11) DEFAULT NULL,
  `rop_qty` int(11) DEFAULT NULL,
  `min_qty` int(11) DEFAULT NULL,
  `max_qty` int(11) DEFAULT NULL,
  `ordering_cost` double(32,16) DEFAULT NULL,
  `carrying_cost` double(32,16) DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `mark_deleted` char(1) DEFAULT 'N' COMMENT 'mark เพื่อลบออกทีหลัง',
  `generic_hosp_id` int(11) DEFAULT NULL COMMENT 'ประเภทยา mm_generic_hosp',
  `group_code_1` varchar(2) DEFAULT NULL,
  `group_code_2` varchar(2) DEFAULT NULL,
  `group_code_3` varchar(2) DEFAULT NULL,
  `group_code_4` varchar(2) DEFAULT NULL,
  PRIMARY KEY (`generic_id`),
  UNIQUE KEY `working_code` (`working_code`),
  KEY `generic_name` (`generic_name`),
  KEY `account_id` (`account_id`),
  KEY `generic_type_id` (`generic_type_id`),
  KEY `primary_unit_id` (`primary_unit_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

