-- ----------------------------
-- Table structure for pc_purchasing_order
-- ----------------------------
DROP TABLE IF EXISTS `pc_purchasing_order`;
CREATE TABLE `pc_purchasing_order` (
  `purchase_order_id` varchar(15) NOT NULL COMMENT 'เลขที่ใบสั่งซื้อ',
  `purchase_order_book_number` varchar(50) DEFAULT NULL COMMENT 'เลขที่หนังสือ',
  `purchase_order_number` varchar(15) DEFAULT NULL COMMENT 'เลขที่ใบสั่งซื้อ(ผู้ใช้)',
  `order_date` datetime DEFAULT NULL COMMENT 'วันที่ออกใบสั่งซื้อ',
  `ordersend_date` datetime DEFAULT NULL,
  `contract_ref` int(11) DEFAULT NULL COMMENT 'เลขที่สัญญา (ref)',
  `contract_id` varchar(15) DEFAULT NULL COMMENT 'เลขที่สัญญา ( ผู้ใช้จัด format เอง )',
  `sub_total` double(32,16) DEFAULT NULL COMMENT 'ราคารวม(ยังไม่หักส่วนลด)',
  `discount_percent` double(32,16) DEFAULT NULL COMMENT 'ส่วนลดเปอร์เซ็น',
  `discount_cash` double(32,16) DEFAULT NULL COMMENT 'ส่วนลดเงินสด',
  `include_vat` enum('Y','N') DEFAULT 'N' COMMENT 'ราคารวมภาษี',
  `exclude_vat` enum('Y','N') DEFAULT 'N' COMMENT 'ราคารวมภาษี',
  `vat_rate` float(2,0) DEFAULT '7' COMMENT 'ภาษี',
  `vat` double(32,16) DEFAULT NULL COMMENT 'จำนวนภาษี',
  `net` double(32,16) DEFAULT NULL COMMENT 'ราคารวมสุธิ',
  `total_price` double(32,16) unsigned DEFAULT NULL COMMENT 'ราคารวมสุธิ ไม่เอา',
  `is_contract` enum('Y','N') DEFAULT 'N' COMMENT 'ใบสั่งซื้อที่มีสัญญา',
  `verify_committee_id` int(11) DEFAULT NULL COMMENT 'รหัสชุดกรรมการตรวจรับ',
  `verify_committee_item` text COMMENT 'รายชื่อกรรมการตรวจรับ',
  `check_price_committee_id` int(11) DEFAULT NULL COMMENT 'รหัสกรรมการสอบราคา',
  `purchase_order_status` enum('ORDERPOINT','PREPARED','CONFIRMED','APPROVED','COMPLETED') DEFAULT 'ORDERPOINT' COMMENT 'สถานะใบสั่งซื้อ',
  `labeler_id` bigint(10) unsigned zerofill DEFAULT NULL COMMENT 'หมายเลขผู้จำหน่าย',
  `egp_id` varchar(15) DEFAULT NULL COMMENT 'เลขที่ e-GP',
  `confirmed_date` datetime DEFAULT NULL COMMENT 'วันที่ยืนยันข้อมูล',
  `approved_by` int(11) DEFAULT NULL COMMENT 'อนุมัติโดย',
  `approved_date` datetime DEFAULT NULL COMMENT 'อนุมัติวันที่',
  `approved_comment` varchar(11) DEFAULT NULL COMMENT 'หมายเหตุอนุมัติ',
  `receive_id` varchar(15) DEFAULT NULL COMMENT 'เลขที่รับจากคลัง',
  `receive_date` datetime DEFAULT NULL COMMENT 'วันที่รับเข้าคลัง',
  `cancel_comment` text COMMENT 'สาเหตุยกเลิก',
  `budgettype_id` int(11) DEFAULT NULL COMMENT 'งบประมาณที่ใช้',
  `budget_detail_id` int(11) DEFAULT NULL,
  `purchase_method_id` int(15) DEFAULT NULL COMMENT 'วิธีการจัดซื้อ',
  `purchase_type_id` int(11) DEFAULT NULL COMMENT 'รูปแบบการจัดซื้อ',
  `is_cancel` enum('Y','N') DEFAULT 'N' COMMENT 'ยกเลิกรายการ',
  `cancel_date` datetime DEFAULT NULL COMMENT 'วันที่ยกเลิก',
  `project_id` int(11) DEFAULT NULL COMMENT 'เลขที่โครงการ',
  `delivery` int(11) DEFAULT NULL COMMENT 'ส่งของภายใน ',
  `vendor_contact_name` varchar(255) DEFAULT NULL COMMENT 'ชื่อผู้ติดต่อ',
  `ship_date` date DEFAULT NULL COMMENT 'วันที่ส่งของ',
  `ship_to` varchar(255) DEFAULT NULL COMMENT 'ที่อยู่สำหรับจัดส่ง',
  `comment` text COMMENT 'หมายเหตุ',
  `note_to_vender` text COMMENT 'หมายเหตุสำหรับผู้ขาย',
  `user_id` int(11) DEFAULT NULL COMMENT 'ผู้บันทึกข้อมูล',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'วันที่สร้าง',
  `updated_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'วันที่แก้ไข',
  `is_receive` enum('Y','N') DEFAULT 'N' COMMENT 'วันที่รับของเข้าคลัง',
  `buyer_id` int(11) DEFAULT NULL COMMENT 'รหัสเจ้าหน้าที่',
  `chief_id` int(11) DEFAULT NULL COMMENT 'รหัสหัวหน้างาน',
  `budget_year` varchar(4) DEFAULT NULL,
  `is_reorder` tinyint(1) DEFAULT '0' COMMENT 'สั่งซื้อจากหน้าจอ reorder point',
  `generic_type_id` int(11) DEFAULT NULL COMMENT 'ประเภท',
  `people_user_id` varchar(20) DEFAULT NULL,
  `update_people_user_id` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`purchase_order_id`),
  UNIQUE KEY `purchase_order_number` (`purchase_order_number`) USING BTREE,
  KEY `contract_id` (`contract_id`),
  KEY `contract_ref` (`contract_ref`),
  KEY `user_id` (`user_id`),
  KEY `order_date` (`order_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

