-- ----------------------------
-- View structure for view_all_product
-- ----------------------------
DROP VIEW IF EXISTS `view_all_product`;
CREATE VIEW `view_all_product` AS select `mp`.`product_id` AS `product_id`,`mp`.`product_name` AS `product_name`,`mg`.`generic_id` AS `generic_id`,`mg`.`generic_name` AS `generic_name`,`mgt`.`generic_type_id` AS `generic_type_id`,`mgt`.`generic_type_name` AS `generic_type_name`,`mgdd`.`dosage_id` AS `dosage_id`,`mgdd`.`dosage_name` AS `dosage_name`,`mgda`.`account_id` AS `drug_account_id`,`mgda`.`account_name` AS `drug_account_name`,`mgdg1`.`group_code_1` AS `group_code_1`,`mgdg1`.`group_name_1` AS `group_name_1`,`mgdg2`.`group_code_2` AS `group_code_2`,`mgdg2`.`group_name_2` AS `group_name_2`,`mgdg3`.`group_code_3` AS `group_code_3`,`mgdg3`.`group_name_3` AS `group_name_3`,`mgdg4`.`group_code_4` AS `group_code_4`,`mgdg4`.`group_name_4` AS `group_name_4`,`mgdt`.`generic_type_id` AS `type_id`,`mgdt`.`generic_type_name` AS `type_name`,`mul`.`unit_id` AS `large_unit_id`,`mul`.`unit_name` AS `large_unit`,`mus`.`unit_id` AS `small_unit_id`,`mus`.`unit_name` AS `small_unit`,`muc`.`qty` AS `small_qty`,`muc`.`unit_generic_id` AS `unit_generic_id` from ((((((((((((`mm_generics` `mg` left join `mm_products` `mp` on((`mg`.`generic_id` = `mp`.`generic_id`))) left join `mm_generic_types` `mgt` on((`mg`.`generic_type_id` = `mgt`.`generic_type_id`))) left join `mm_generic_dosages` `mgdd` on((`mg`.`dosage_id` = `mgdd`.`dosage_id`))) left join `mm_unit_generics` `muc` on((`mp`.`generic_id` = `muc`.`generic_id`))) left join `mm_units` `mul` on((`muc`.`from_unit_id` = `mul`.`unit_id`))) left join `mm_units` `mus` on((`muc`.`to_unit_id` = `mus`.`unit_id`))) left join `mm_generic_accounts` `mgda` on((`mg`.`account_id` = `mgda`.`account_id`))) left join `mm_generic_group_1` `mgdg1` on((`mg`.`group_code_1` = `mgdg1`.`group_code_1`))) left join `mm_generic_group_2` `mgdg2` on((`mg`.`group_code_2` = `mgdg2`.`group_code_2`))) left join `mm_generic_group_3` `mgdg3` on((`mg`.`group_code_3` = `mgdg3`.`group_code_3`))) left join `mm_generic_group_4` `mgdg4` on((`mg`.`group_code_4` = `mgdg4`.`group_code_4`))) left join `mm_generic_types` `mgdt` on((`mg`.`generic_type_id` = `mgdt`.`generic_type_id`)));

-- ----------------------------
-- View structure for view_budget
-- ----------------------------
DROP VIEW IF EXISTS `view_budget`;
CREATE VIEW `view_budget` AS select `bd`.`bg_year` AS `bg_year`,`bd`.`bgtype_id` AS `bgtype_id`,`bt`.`bgtype_name` AS `bgtype_name`,sum(`bd`.`amount`) AS `amount` from (`bm_budget_detail` `bd` join `bm_bgtype` `bt` on((`bt`.`bgtype_id` = `bd`.`bgtype_id`))) where (`bd`.`status` = 'APPROVE') group by `bd`.`bg_year`,`bt`.`bgtype_name`;

-- ----------------------------
-- View structure for view_budget_subtype
-- ----------------------------
DROP VIEW IF EXISTS `view_budget_subtype`;
CREATE VIEW `view_budget_subtype` AS select `bd`.`bgdetail_id` AS `bgdetail_id`,`bd`.`bg_year` AS `bg_year`,`bd`.`bgtype_id` AS `bgtype_id`,`bt`.`bgtype_name` AS `bgtype_name`,`bd`.`bgtypesub_id` AS `bgtypesub_id`,`bs`.`bgtypesub_name` AS `bgtypesub_name`,sum(`bd`.`amount`) AS `amount` from ((`bm_budget_detail` `bd` join `bm_bgtype` `bt` on((`bt`.`bgtype_id` = `bd`.`bgtype_id`))) left join `bm_bgtypesub` `bs` on((`bs`.`bgtypesub_id` = `bd`.`bgtypesub_id`))) where (`bd`.`status` = 'APPROVE') group by `bd`.`bg_year`,`bd`.`bgtype_id`,`bd`.`bgtypesub_id`;

-- ----------------------------
-- View structure for view_cm_products_active
-- ----------------------------
DROP VIEW IF EXISTS `view_cm_products_active`;
CREATE VIEW `view_cm_products_active` AS select `cd`.`contract_detail_id` AS `contract_detail_id`,`cd`.`contract_id` AS `contract_id`,`cd`.`product_id` AS `product_id`,`cd`.`qty` AS `qty`,`cd`.`cost` AS `cost`,`cd`.`unit_generic_id` AS `unit_generic_id`,`ct`.`contract_status` AS `contract_status`,`ct`.`contract_no` AS `contract_no`,`ct`.`prepare_no` AS `prepare_no`,`ct`.`end_date` AS `end_date` from (`cm_contract_detail` `cd` join `cm_contracts` `ct` on((`ct`.`contract_id` = `cd`.`contract_id`))) where ((`ct`.`contract_status` not in ('CANCEL','SUCCESS')) or (`ct`.`end_date` < curdate())) group by `cd`.`product_id`,`ct`.`contract_id`;

