-- ----------------------------
-- View structure for view_pc_purchasing_order_item
-- ----------------------------
DROP VIEW IF EXISTS `view_pc_purchasing_order_item`;
CREATE VIEW `view_pc_purchasing_order_item` AS select `pc_purchasing_order_item`.`purchase_order_item_id` AS `purchase_order_item_id`,`pc_purchasing_order_item`.`purchase_order_id` AS `purchase_order_id`,`pc_purchasing_order_item`.`generic_id` AS `generic_id`,`pc_purchasing_order_item`.`product_id` AS `product_id`,`pc_purchasing_order_item`.`qty` AS `qty`,`pc_purchasing_order_item`.`unit_price` AS `unit_price`,`pc_purchasing_order_item`.`total_price` AS `total_price`,`pc_purchasing_order_item`.`free_qty` AS `free_qty`,`pc_purchasing_order_item`.`free_total_price` AS `free_total_price`,`pc_purchasing_order_item`.`labeler_id` AS `labeler_id`,`pc_purchasing_order_item`.`giveaway` AS `giveaway`,`pc_purchasing_order_item`.`discount_percent` AS `discount_percent`,`pc_purchasing_order_item`.`discount_cash` AS `discount_cash`,`pc_purchasing_order_item`.`created_date` AS `created_date`,`pc_purchasing_order_item`.`updated_date` AS `updated_date`,`pc_purchasing_order`.`order_date` AS `order_date`,`pc_purchasing_order`.`contract_ref` AS `contract_ref`,`pc_purchasing_order`.`contract_id` AS `contract_id`,`pc_purchasing_order`.`is_contract` AS `is_contract`,`pc_purchasing_order`.`total_price` AS `po_price`,`pc_purchasing_order`.`purchase_order_status` AS `purchase_order_status`,`pc_purchasing_order`.`egp_id` AS `egp_id`,`pc_purchasing_order`.`confirmed_date` AS `confirmed_date`,`pc_purchasing_order`.`approved_by` AS `approved_by`,`pc_purchasing_order`.`approved_date` AS `approved_date`,`pc_purchasing_order`.`approved_comment` AS `approved_comment`,`pc_purchasing_order`.`receive_id` AS `receive_id`,`pc_purchasing_order`.`receive_date` AS `receive_date`,`pc_purchasing_order`.`cancel_comment` AS `cancel_comment`,`pc_purchasing_order`.`budgettype_id` AS `budgettype_id`,`pc_purchasing_order`.`purchase_method_id` AS `purchase_method_id`,`pc_purchasing_order`.`comment` AS `comment`,`pc_purchasing_order`.`is_cancel` AS `is_cancel`,`pc_purchasing_order`.`cancel_date` AS `cancel_date`,`pc_purchasing_order`.`user_id` AS `user_id`,`pc_purchasing_order`.`verify_committee_id` AS `verify_committee_id`,`pc_purchasing_order`.`verify_committee_item` AS `verify_committee_item`,`pc_purchasing_order`.`check_price_committee_id` AS `check_price_committee_id`,`pc_purchasing_order`.`discount_percent` AS `po_discount_percent`,`pc_purchasing_order`.`vat` AS `po_vat`,`pc_purchasing_order`.`discount_cash` AS `po_discount_cash` from (`pc_purchasing_order_item` join `pc_purchasing_order` on((`pc_purchasing_order_item`.`purchase_order_id` = `pc_purchasing_order`.`purchase_order_id`)));

-- ----------------------------
