-- ----------------------------
-- View structure for view_stock_card_warehouse
-- ----------------------------
DROP VIEW IF EXISTS `view_stock_card_warehouse`;
CREATE VIEW `view_stock_card_warehouse` AS select `ws`.`unit_generic_id` AS `unit_generic_id`,`ws`.`stock_card_id` AS `stock_card_id`,`ws`.`product_id` AS `product_id`,`ws`.`generic_id` AS `generic_id`,`mg`.`generic_name` AS `generic_name`,`ws`.`stock_date` AS `stock_date`,`ws`.`transaction_type` AS `transaction_type`,`ws`.`comment` AS `COMMENT`,`ws`.`document_ref` AS `document_ref`,`ws`.`document_ref_id` AS `document_ref_id`,`mus`.`unit_name` AS `small_unit`,`mu`.`unit_name` AS `large_unit`,`mug`.`qty` AS `conversion_qty`,`mgd`.`dosage_name` AS `dosage_name`,`ws`.`lot_no` AS `lot_no`,`ws`.`expired_date` AS `expired_date`,`ws`.`ref_src` AS `ref_src`,`ws`.`ref_dst` AS `ref_dst`,if((`ww`.`warehouse_name` is not null),`ww`.`warehouse_name`,if((`ml`.`labeler_name` is not null),`ml`.`labeler_name`,if((`wa`.`warehouse_name` is not null),`wa`.`warehouse_name`,if((`dt`.`donator_name` is not null),`dt`.`donator_name`,NULL)))) AS `warehouse_name`,if(((`ws`.`transaction_type` = 'TRN_IN') or (`ws`.`transaction_type` = 'REV') or (`ws`.`transaction_type` = 'REV_OTHER') or (`ws`.`transaction_type` = 'ADJUST') or (`ws`.`transaction_type` = 'REQ_IN') or (`ws`.`transaction_type` = 'ADD_IN') or (`ws`.`transaction_type` = 'SUMMIT')),`ws`.`in_qty`,'0') AS `in_qty`,if(((`ws`.`transaction_type` = 'TRN_OUT') or (`ws`.`transaction_type` = 'ADJUST') or (`ws`.`transaction_type` = 'IST') or (`ws`.`transaction_type` = 'REQ_OUT') or (`ws`.`transaction_type` = 'ADD_OUT')),`ws`.`out_qty`,'0') AS `out_qty`,if(((`ws`.`transaction_type` = 'TRN_IN') or (`ws`.`transaction_type` = 'REV') or (`ws`.`transaction_type` = 'REV_OTHER') or (`ws`.`transaction_type` = 'SUMMIT')),(`ws`.`in_qty` * `ws`.`balance_unit_cost`),(`ws`.`out_qty` * `ws`.`balance_unit_cost`)) AS `cost`,`ws`.`balance_generic_qty` AS `balance_generic_qty`,`ws`.`balance_qty` AS `balance_qty`,`ws`.`balance_unit_cost` AS `balance_unit_cost`,(`ws`.`balance_generic_qty` * `ws`.`balance_unit_cost`) AS `balance_amount`,if((`ws`.`transaction_type` = 'REV'),`ws`.`ref_dst`,if((`ws`.`transaction_type` = 'TRN_IN'),`ws`.`ref_dst`,if((`ws`.`transaction_type` = 'TRN_OUT'),`ws`.`ref_src`,if((`ws`.`transaction_type` = 'ADJUST'),`ws`.`ref_src`,if((`ws`.`transaction_type` = 'IST'),`ws`.`ref_src`,if((`ws`.`transaction_type` = 'IST'),`ws`.`ref_src`,if((`ws`.`transaction_type` = 'REV_OTHER'),`ws`.`ref_dst`,if((`ws`.`transaction_type` = 'REQ_OUT'),`ws`.`ref_src`,if((`ws`.`transaction_type` = 'REQ_IN'),`ws`.`ref_src`,if((`ws`.`transaction_type` = 'ADD_IN'),`ws`.`ref_dst`,if((`ws`.`transaction_type` = 'ADD_OUT'),`ws`.`ref_src`,if((`ws`.`transaction_type` = 'SUMMIT'),`ws`.`ref_src`,if((`ws`.`transaction_type` = 'HIS'),`ws`.`ref_src`,''))))))))))))) AS `warehouse_id` from ((((((((((`wm_stock_card` `ws` join `mm_generics` `mg` on((`mg`.`generic_id` = `ws`.`generic_id`))) left join `mm_labelers` `ml` on(if((`ws`.`transaction_type` = 'REV'),(cast(`ml`.`labeler_id` as signed) = `ws`.`ref_src`),''))) left join `wm_donators` `dt` on(if((`ws`.`transaction_type` = 'REV_OTHER'),(cast(`dt`.`donator_id` as signed) = `ws`.`ref_src`),''))) left join `wm_warehouses` `ww` on(if(((`ws`.`transaction_type` = 'TRN_OUT') or (`ws`.`transaction_type` = 'REQ_OUT') or (`ws`.`transaction_type` = 'ADD_OUT') or (`ws`.`transaction_type` = 'REQ_IN')),(`ww`.`warehouse_id` = `ws`.`ref_dst`),''))) left join `wm_warehouses` `wa` on(if(((`ws`.`transaction_type` = 'TRN_IN') or (`ws`.`transaction_type` = 'ADD_IN')),(`wa`.`warehouse_id` = `ws`.`ref_src`),''))) left join `mm_products` `mp` on((`mp`.`product_id` = `ws`.`product_id`))) left join `mm_unit_generics` `mug` on((`mug`.`unit_generic_id` = `ws`.`unit_generic_id`))) left join `mm_units` `mu` on((`mug`.`from_unit_id` = `mu`.`unit_id`))) left join `mm_units` `mus` on((`mug`.`to_unit_id` = `mus`.`unit_id`))) left join `mm_generic_dosages` `mgd` on((`mg`.`dosage_id` = `mgd`.`dosage_id`))) order by `ws`.`stock_date`,`ws`.`stock_card_id`;

